import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Obituary ()
{
    const [data, setData] = useState([])
    
    useEffect( () =>
    {
        axios.get( 'http://localhost:8081/' )
            .then( res => setData(res.data) )
            .catch( err => console.error( err ) );
    }, [] );

  return (
      <div>
          
      </div>
  )
}

export default Obituary
